import React from "react";
import { MDBRow, MDBCol, MDBBtn, MDBIcon} from "mdbreact";
import logo from '../assets/images/logo.png';

interface State {
    isOpen: any,
    user: boolean,
    username: any,
}
interface IProps {
    props?: any,
    UserChange? :any
}
export class Header extends React.Component<IProps, State> {
    constructor(props:any) {
        super(props);
        this.state = {
            isOpen: false,
            user: false,
            username: 'user',
        };
      }

    toggleCollapse = () => {
        this.setState({ isOpen: !this.state.isOpen });
    }

    Logout = () => {
        console.log(this.props)
        this.props.UserChange(undefined)
        this.setState({user: false})
    }

    componentDidMount() {
        console.log(this.props)
    }
    componentDidUpdate(prevProps:any, newProps:any) {
        console.log(prevProps)
        console.log(this.props.props)
        if(this.props.props !== undefined && this.props !== false && this.props !== prevProps  && this.props !== 'undefined' && this.props !== null) {
            this.setState({user: true})
            console.log(this.props)
            this.setState({username: this.props.props.username })

        }
    }

    render() {
        return (
            <MDBRow className="watcherHeader" style={{ backgroundColor: "white", height: "7vh", minHeight: "70px" }}>
            <MDBCol sm="3" md="4" lg="4">
                <div className='font-weight-bold' style={{ padding: "1.5vw", display: "inline-flex" }}>
                    <p className='text-dark' style={{ fontSize: "20px" }}>Dashboard 
                    <span className='text-light' style={{ fontSize: "12px", marginLeft: "10px" }}>www.sampleapplication.com</span></p>
                </div>
            </MDBCol>
            <MDBCol sm="7" md="7" lg="7">
                <div style={{ padding: "10px", float: "right" }}>
                    <MDBBtn style={{ border: "2px solid #2bbbad", borderRadius: "10px" }}>Export 
                    <MDBIcon icon="file-download" style={{ fontSize: "15px", marginLeft: "3px" }} /></MDBBtn>
                    <MDBBtn style={{ border: "2px solid #2bbbad", borderRadius: "10px" }}>Notifications 
                    <MDBIcon icon="bell" style={{ fontSize: "15px", marginLeft: "3px" }} /><span className="badge">3</span></MDBBtn>
                </div>
            </MDBCol>
            <MDBCol sm="1" md="1" lg="1">
                <div style={{ paddingTop: "20px" }}>
                    <MDBIcon icon="user-circle" style={{ fontSize: "25px", marginLeft: "20px" }} />
                </div>
            </MDBCol>
        </MDBRow>
        );
    }
}
